import React from 'react';
import './App.css';
import { BrowserRouter as Router, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Aplikacija za lov</h1>
          <div className="Menu">
            <Button text="EVIDENCIJA LOVACA" path="/popis-lovaca" />
            <Button text="RASPORED AKTIVNOSTI I LOVA" path="/raspored-aktivnosti" />
            <Button text="EVIDENCIJA PRISUTNOSTI NA LOVNI DAN" path="/popis-lova" />
            <Button text="UNOS DIVLJAČI" path="/unos-divljaci" />
            <Button text="UNOS ODSTRIJELENE DIVLJAČI" path="/unos-ostrijela" />
            <Button text="BODOVI" path="/popis-bodova" />
          </div>
        </header>
      </div>
    </Router>
  );
}

function Button({ text, path }) {
  return (
    <Link to={path} className="Button">
      {text}
    </Link>
  );
}

export default App;
